cells.notes:
// regripless if you start with your thumb underneath on D.

[z R: [U2, R D' R']]
[U' R U: [R U R', D]]

// main alg can be done with no regrips
[D R D' R': [U', R' D R]]
[z' R: [U2, R D R']]

// execute like M U r' F' M2 F r U' M
// or do
[M: [U L' U', M2]]

// R' r2 to start?
[R' F': [R U' R', E]]
[U' R2 U, M]

// Execute like l' U L U' M2 U L' U' (M' L)
// or
[U2 D: [R' F R, S']]

// l' U' L U M' U' L' U l2 L'
[L F: [E', L' U L]]
[U' D: [R' F R, S']]

// a few good options
[U': [R S R', F']]
[u' R': U M' U2 M U]

// mirror is nice too
M' U (M' U M U2 M U' M' U2) U' M
[U r: [U' R' U, M']]

// D' with left ring push
[r U r', S]
[D, M' U' M]

// has one has one regrip mid-alg instead of two. 
// this one below is OK.
[U F2: [SWAP]]
